    <style>
        /* Style Settings */
@import url("https://fonts.googleapis.com/css2?family=Open+Sans:wght@300;400;600&display=swap");
:root {
  --bgColor: #000;
  --fgColor: #fff;
  --accentColor: rgba(255, 255, 255, 0.3);
  --font: "Open Sans", sans-serif;
}

body {
  background-color: var(--bgColor);
  color: var(--fgColor);
  font-family: var(--font);
  font-weight: 600;
}

a {
  text-decoration: none;
}

#userPhoto {
  width: 100px;
  height: 100px;
  display: block;
  margin: 10px auto;
  border-radius: 20%;
}

#userName {
  display: block;
  width: 100%;
  text-align: center;
  color: var(--fgColor);
  font-size: 2rem;
  font-weight: 300;
  letter-spacing: 0.2rem;
  margin: 0 auto;
}

#description {
  font-weight: 300;
  width: 100%;
  text-align: center;
  margin-top: 5px;
  text-transform: none;
}

#description2 {
  font-weight: 250;
  width: 100%;
  text-align: center;
  margin-top: 5px;
  text-transform: none;
}

ion-icon {
  margin-right: 0.3rem;
}

#links {
  max-width: 500px;
  width: auto;
  display: block;
  margin: 20px auto;
}

.link {
  display: block;
  background-color: rgba(66, 110, 255, 0.2);
  color: var(--fgColor);
  text-align: center;
  margin-bottom: 20px;
  padding: 17px;
  font-size: 1.2rem;
  font-weight: 300;
  transition: all 0.25s cubic-bezier(0.08, 0.59, 0.29, 0.99);
  border-radius: 10px;
}

.link:hover {
  background-color: var(--accentColor);
  color: var(--bgColor);
  border: none;
}

ion-icon {
  vertical-align: text-bottom;
  width: 1.1875em;
  height: 1.1875em;
}

    </style>
    </head>
